import React from 'react';
import { Logo} from "../components/Logo";
import Nav from "../components/Nav";

class Header extends React.Component {
    render() {
        return (
        <>
            <header>
                <div className='container'>
                    <Logo />
                    <Nav />
                </div>
            </header>
        </>
        );
    }
}

export default Header;
